/**
 * Created by Lenovo on 2019/8/7.
 */
import React from 'react';
import './index.css';
import backBlock from '../image/title/back-block.png';
import backWhite from '../image/title/back-white.png';
export default class Title extends React.Component {
    constructor(props) {
        super(props);
    }
    componentDidMount(){
        console.log(this);
    }
    onLeftClick(){
        const {onLeftClick} =this.props;
        if(onLeftClick){
            onLeftClick();
        }else {
            console.log(this.props)
            this.props.history.goBack();
        }
    }
    render() {
        const {title,isHome,isBack} =this.props;
        if(isHome && !isBack ){
            return (
                <div>
                    <div className="title-home"><span>{title}</span></div>
                </div>
            )
        }else if(isHome && isBack){
            return (
                <div className="title-home">
                    <div className="title cm-c-white">
                        <img src={backWhite} alt="" className="title-img" onClick={()=>this.onLeftClick()}/>
                        <span>{title}</span>
                        <div className="title-img"></div>
                    </div>
                    <div className="title-solid"></div>
                </div>
            )
        }else {
            return (
                <div className="title-bg">
                    <div className="title cm-c-333">
                        <img src={backBlock} alt="" className="title-img" onClick={()=>this.onLeftClick()}/>
                        <span>{title}</span>
                        <div className="title-img"></div>
                    </div>
                    <div className="title-solid"></div>
                </div>
            )
        }
    }
}
